import { StatusBar } from "expo-status-bar";
import React,{useState} from "react";
import { StyleSheet, Text, View } from "react-native";
import { CustomInput } from "../../Component/CustomInput";
import { FontAwesome5 } from '@expo/vector-icons'; 
import { Button, TextInput } from 'react-native-paper';
const [showDropDown, setShowDropDown] = useState(false);

export default function Home() {
  return (
    <View style={styles.container}>
      <Text>Open up App.js to start working on your app!</Text>
     <View style={{width:200,height:50}}>
     <CustomInput 
     rightIcon={<TextInput.Icon size={24}  color= '#C20000' name="chevron-down" />}
    placeholder="sf"
    style={{backgroundColor:"grey"}}
      theme={{ colors: { primary: "white" } }}
      underlineColor="transparent"
onClick={()=>{setShowDropDown(true)}}
      />
     </View>
     <View style={{ flex: 1 }} showDropDown>
    <Menu.Item icon="redo" onPress={() => {}} title="Redo" />
    <Menu.Item icon="undo" onPress={() => {}} title="Undo" />
    <Menu.Item icon="content-cut" onPress={() => {}} title="Cut" disabled />
    <Menu.Item icon="content-copy" onPress={() => {}} title="Copy" disabled />
    <Menu.Item icon="content-paste" onPress={() => {}} title="Paste" />
  </View>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
